import React from "react";
import "./CodeIs.css";

export default class codeIs extends React.Component {
  render() {
    return (
      <div>
        <div class="banner-wrapper-fixed">
              <div class="foreground">
                <h1 class="codeis">Desenvolvimento Full Stack</h1>
              </div>
          </div>
      </div>
    );
  }
}
